import React from 'react'
const data = [
    { title: "À propos", value: "about" },
    { title: "Tarifs", value: "tarifs" },
    { title: "Contact", value: "contact" },
  ];

  const handleScroll = (id) => {
    const element = document.getElementById(id);
    element.scrollIntoView({ behavior: "smooth" });
  };


const Links = () => {
  return (
    <nav className="w-100">
      <ul className="d-flex flex-column justify-content-around nav list-unstyled">
        {data.map((item, index) => (
            <li className="text-white" role="button" key={index} onClick={() => handleScroll(item.value)}>{item.title}</li>
        ))}
      </ul>
    </nav>
  )
}

export default Links
